static void setChannelSelection(CHANNEL_SELECTION_e ch)
{
   WM_HWIN hItem;

   if( hOwnHandle != 0 )
   {
      hItem = WM_GetDialogItem(hOwnHandle, ID_TEXT_CHANNEL);
      if( ch == CHANNEL_SEL_CH1 )
      {
         TEXT_SetBkColor(hItem, GUI_BLUE);
         TEXT_SetTextColor(hItem, GUI_WHITE);
         TEXT_SetText(hItem, "CH1");
	  }
	  else if( ch == CHANNEL_SEL_CH2 )
	  {
         TEXT_SetBkColor(hItem, GUI_BLUE);
         TEXT_SetTextColor(hItem, GUI_WHITE);
         TEXT_SetText(hItem, "CH2");
	  }
	  else
	  {
         TEXT_SetBkColor(hItem, GUI_WHITE);
         TEXT_SetTextColor(hItem, GUI_RED);
         TEXT_SetText(hItem, "OFF");
	  }
   }
}

static void setTriggerEdgeSelection(TRIGGER_EDGE_e te)
{
   WM_HWIN hItem;
   const void * pData;
   U32          FileSize;

   if( hOwnHandle != 0 )
   {
      if( te == TRIGGER_EDGE_RISING )
      {
         hItem = WM_GetDialogItem(hOwnHandle, ID_IMAGE_TRIGEDGE);
         pData = _GetImageById(ID_IMAGE_2_IMAGE_0, &FileSize);
         IMAGE_SetBMP(hItem, pData, FileSize);
	  }
	  else if( te == TRIGGER_EDGE_FALLING )
	  {
  	     hItem = WM_GetDialogItem(hOwnHandle, ID_IMAGE_TRIGEDGE);
  	     pData = _GetImageById(ID_IMAGE_3_IMAGE_0, &FileSize);
  	     IMAGE_SetBMP(hItem, pData, FileSize);
	  }
	  else
	  {
  	     hItem = WM_GetDialogItem(hOwnHandle, ID_IMAGE_TRIGEDGE);
  	     pData = _GetImageById(ID_IMAGE_4_IMAGE_0, &FileSize);
  	     IMAGE_SetBMP(hItem, pData, FileSize);
	  }
   }
}

static void setTriggerModeSelection(TRIGGER_MODE_e tm)
{
   WM_HWIN hItem;

   if( hOwnHandle != 0 )
   {
      hItem = WM_GetDialogItem(hOwnHandle, ID_TEXT_TRIGMODE);
      if( tm == TRIGGER_MODE_NORMAL )
      {
   	     TEXT_SetText(hItem, "NORMAL");
	  }
	  else if( tm == TRIGGER_MODE_AUTO )
	  {
   	     TEXT_SetText(hItem, "AUTO");
	  }
	  else // TRIGGER_MODE_SINGLE
	  {
   	     TEXT_SetText(hItem, "SINGLE");
	  }
   }
}

static void modifyTriggerValue(int32_t step)
{
   char textBuf[10];
   WM_HWIN hItem;

   if( hOwnHandle != 0 )
   {
      if(currentChannelSelection == CHANNEL_SEL_CH1)
      {
         currentTriggerValueCH1 += step;
         if( currentTriggerValueCH1 > 4095 )
        	 currentTriggerValueCH1 = 4095;
         if( currentTriggerValueCH1 < 0 )
        	 currentTriggerValueCH1 = 0;
         snprintf(textBuf, 10, "%d", currentTriggerValueCH1);
      }
      else if(currentChannelSelection == CHANNEL_SEL_CH2)
      {
         currentTriggerValueCH2 += step;
         if( currentTriggerValueCH2 > 4095 )
        	 currentTriggerValueCH2 = 4095;
         if( currentTriggerValueCH2 < 0 )
        	 currentTriggerValueCH2 = 0;
         snprintf(textBuf, 10, "%d", currentTriggerValueCH2);
      }
      else
      {
         snprintf(textBuf, 10, "---");
      }
      hItem = WM_GetDialogItem(hOwnHandle, ID_TEXT_VALUE);
      TEXT_SetText(hItem, textBuf);
   }
}

