/*********************************************************************
*
*       _cbDialog
*/
static void _cbTriggerDialog(WM_MESSAGE * pMsg) {
  const void * pData;
  WM_HWIN      hItem;
  U32          FileSize;
  int          NCode;

  switch (pMsg->MsgId) {
  case WM_INIT_DIALOG:
	//
	// Initialization of 'TextCH1'
	//
	hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_CHANNEL);
	TEXT_SetFont(hItem, GUI_FONT_32B_ASCII);
	TEXT_SetText(hItem, "CH1");
	TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
	TEXT_SetTextColor(hItem, GUI_BLACK);
#if 0
    //
    // Initialization of 'TextCH2'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_CH2);
    TEXT_SetFont(hItem, GUI_FONT_32B_ASCII);
    TEXT_SetText(hItem, "CH2");
    TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
    TEXT_SetTextColor(hItem, GUI_BLACK);
#endif
#if 0
    //
    // Initialization of 'TextRUN/HOLD'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_RUN);
    TEXT_SetFont(hItem, GUI_FONT_32B_ASCII);
    TEXT_SetText(hItem, "RUN");
    TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
    TEXT_SetTextColor(hItem, GUI_MAKE_COLOR(0x000000FF));
#endif
    //
    // Initialization of 'TextNormal'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_TRIGMODE);
    TEXT_SetFont(hItem, GUI_FONT_20B_ASCII);
    TEXT_SetText(hItem, "Normal");
    TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
    TEXT_SetTextColor(hItem, GUI_BLACK);
#if 0
    //
    // Initialization of 'TextAuto'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_AUTO);
    TEXT_SetFont(hItem, GUI_FONT_20B_ASCII);
    TEXT_SetText(hItem, "Auto");
    TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
    TEXT_SetTextColor(hItem, GUI_BLACK);
    //
    // Initialization of 'TextSingle'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_SINGLE);
    TEXT_SetFont(hItem, GUI_FONT_20B_ASCII);
    TEXT_SetText(hItem, "Single");
    TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
    TEXT_SetTextColor(hItem, GUI_BLACK);
#endif
    //
    // Initialization of 'Image'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_ARROWUP);
    pData = _GetImageById(ID_IMAGE_0_IMAGE_0, &FileSize);
    IMAGE_SetBMP(hItem, pData, FileSize);
    //
    // Initialization of 'Image'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_ARROWDOWN);
    pData = _GetImageById(ID_IMAGE_1_IMAGE_0, &FileSize);
    IMAGE_SetBMP(hItem, pData, FileSize);
    //
    // Initialization of 'Text'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_VALUE);
    TEXT_SetFont(hItem, GUI_FONT_16B_ASCII);
    TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
    TEXT_SetText(hItem, "0");
    TEXT_SetTextColor(hItem, GUI_BLACK);
    //
    // Initialization of 'Image'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_TRIGEDGE);
    pData = _GetImageById(ID_IMAGE_2_IMAGE_0, &FileSize);
    IMAGE_SetBMP(hItem, pData, FileSize);
#if 0
    //
    // Initialization of 'Image'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_3);
    pData = _GetImageById(ID_IMAGE_3_IMAGE_0, &FileSize);
    IMAGE_SetBMP(hItem, pData, FileSize);
    //
    // Initialization of 'Image'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_4);
    pData = _GetImageById(ID_IMAGE_4_IMAGE_0, &FileSize);
    IMAGE_SetBMP(hItem, pData, FileSize);
#endif
    //
    // Initialization of 'Image'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_ARROWLEFT);
    pData = _GetImageById(ID_IMAGE_5_IMAGE_0, &FileSize);
    IMAGE_SetBMP(hItem, pData, FileSize);
    //
    // Initialization of 'Image'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_ARROWRIGHT);
    pData = _GetImageById(ID_IMAGE_6_IMAGE_0, &FileSize);
    IMAGE_SetBMP(hItem, pData, FileSize);

    hRepeateTimer = WM_CreateTimer(pMsg->hWin, ID_REPEATE_TIMER, 0, 0);
    break;

  case WM_TIMER:
	if( pressedKey != ARROW_KEY_NONE )
	{
       switch( pressedKey )
       {
       case ARROW_KEY_UP:
          modifyTriggerValue(+10);
          break;
       case ARROW_KEY_DOWN:
          modifyTriggerValue(-10);
          break;
       }

       if( currentChannelSelection == CHANNEL_SEL_CH1 )
		  osziSetTriggerValue(currentChannelSelection, (uint16_t)currentTriggerValueCH1);
       if( currentChannelSelection == CHANNEL_SEL_CH2 )
		  osziSetTriggerValue(currentChannelSelection, (uint16_t)currentTriggerValueCH2);

       currentRepeateTime -= 10;
       if( currentRepeateTime < 20) currentRepeateTime = 20;
       WM_RestartTimer(pMsg->Data.v, currentRepeateTime);
	}
    break;

  case WM_NOTIFY_PARENT:
    hItem    = WM_GetId(pMsg->hWinSrc);    /* Id of widget */
    NCode = pMsg->Data.v;               /* Notification code */

    if( hItem == ID_TEXT_CHANNEL )
    {
      if( NCode == WM_NOTIFICATION_CLICKED)
      {
   	     currentChannelSelection++;
   	     if(currentChannelSelection > CHANNEL_SEL_CH2)
   	    	currentChannelSelection = CHANNEL_SEL_NONE;
         setChannelSelection( currentChannelSelection );
         modifyTriggerValue(0);
         //TODO:WW: Implement callback or user message for time selection handling
         osziSetTriggerChannel(currentChannelSelection);
      }
    }
    else if( hItem == ID_IMAGE_TRIGEDGE )
    {
      if( NCode == WM_NOTIFICATION_CLICKED)
      {
    	  currentTriggerEdge++;
    	  if(currentTriggerEdge > TRIGGER_EDGE_BOUTH)
    		  currentTriggerEdge = TRIGGER_EDGE_RISING;
          setTriggerEdgeSelection(currentTriggerEdge);
        //TODO:WW: Implement callback or user message for time selection handling
          osziSetTriggerEdge(currentTriggerEdge);
      }
    }
    else if( hItem == ID_TEXT_TRIGMODE )
    {
       if( NCode == WM_NOTIFICATION_CLICKED)
       {
          currentTriggerMode++;
          if( currentTriggerMode > TRIGGER_MODE_SINGLE )
    	     currentTriggerMode = TRIGGER_MODE_NORMAL;
          setTriggerModeSelection( currentTriggerMode );
          //TODO:WW: Implement callback or user message for time selection handling
          osziSetTriggerMode(currentTriggerMode);
       }
    }
    else if( hItem == ID_IMAGE_ARROWUP ) // UP
    {
      if( NCode == WM_NOTIFICATION_CLICKED)
      {
		pressedKey = ARROW_KEY_UP;
        //TODO:WW: Implement callback or user message for arrow key handling
		modifyTriggerValue(+10);
        if( currentChannelSelection == CHANNEL_SEL_CH1 )
           osziSetTriggerValue(currentChannelSelection, (uint16_t)currentTriggerValueCH1);
        if( currentChannelSelection == CHANNEL_SEL_CH2 )
	       osziSetTriggerValue(currentChannelSelection, (uint16_t)currentTriggerValueCH2);
		currentRepeateTime = 200;
        WM_RestartTimer(hRepeateTimer, currentRepeateTime);
      }
      else if( NCode == WM_NOTIFICATION_RELEASED)
      {
  		pressedKey = ARROW_KEY_NONE;
        WM_RestartTimer(hRepeateTimer, 0);
  		//osziHandleArrowKey(pressedKey);
      }
    }
    else if( hItem == ID_IMAGE_ARROWDOWN ) // DOWN
    {
      if( NCode == WM_NOTIFICATION_CLICKED)
      {
		pressedKey = ARROW_KEY_DOWN;
        //TODO:WW: Implement callback or user message for arrow key handling
		modifyTriggerValue(-10);
       if( currentChannelSelection == CHANNEL_SEL_CH1 )
		  osziSetTriggerValue(currentChannelSelection, (uint16_t)currentTriggerValueCH1);
       if( currentChannelSelection == CHANNEL_SEL_CH2 )
		  osziSetTriggerValue(currentChannelSelection, (uint16_t)currentTriggerValueCH2);
		currentRepeateTime = 200;
        WM_RestartTimer(hRepeateTimer, currentRepeateTime);
      }
      else if( NCode == WM_NOTIFICATION_RELEASED)
      {
  		pressedKey = ARROW_KEY_NONE;
        WM_RestartTimer(hRepeateTimer, 0);
  		//osziHandleArrowKey(pressedKey);
      }
    }
    else if( hItem == ID_IMAGE_ARROWLEFT ) // LEFT
    {
      if( NCode == WM_NOTIFICATION_CLICKED)
      {
		pressedKey = ARROW_KEY_LEFT;
        //TODO:WW: Implement callback or user message for arrow key handling
		//osziHandleArrowKey(pressedKey);
		currentRepeateTime = 200;
        WM_RestartTimer(hRepeateTimer, currentRepeateTime);
      }
      else if( NCode == WM_NOTIFICATION_RELEASED)
      {
  		pressedKey = ARROW_KEY_NONE;
        WM_RestartTimer(hRepeateTimer, 0);
  		//osziHandleArrowKey(pressedKey);
      }
    }
    else if( hItem == ID_IMAGE_ARROWRIGHT ) // RIGHT
    {
      if( NCode == WM_NOTIFICATION_CLICKED)
      {
		pressedKey = ARROW_KEY_RIGHT;
        //TODO:WW: Implement callback or user message for arrow key handling
		//osziHandleArrowKey(pressedKey);
		currentRepeateTime = 200;
        WM_RestartTimer(hRepeateTimer, currentRepeateTime);
      }
      else if( NCode == WM_NOTIFICATION_RELEASED)
      {
  		pressedKey = ARROW_KEY_NONE;
        WM_RestartTimer(hRepeateTimer, 0);
  		//osziHandleArrowKey(pressedKey);
      }
    }
    break;

  case WM_DELETE:
    if(hRepeateTimer!=0)
    {
       WM_DeleteTimer(hRepeateTimer);
       hRepeateTimer = 0;
    }
    break;

  default:
    WM_DefaultProc(pMsg);
    break;
  }
}

