/*********************************************************************
*
*       CreateTrigger
*/
WM_HWIN CreateTriggerDialog(WM_HWIN hParent)
{
  hOwnHandle = GUI_CreateDialogBox(_TriggerDialogCreate, GUI_COUNTOF(_TriggerDialogCreate), _cbTriggerDialog, hParent, 0, 0);
  WM_HideWindow(hOwnHandle);

  return hOwnHandle;
}

void TriggerDialog_SetConfig(TRIGGER_CONFIG_t* config)
{
   char textBuf[10];
   WM_HWIN hItem;

   currentChannelSelection = config->channel;

   if( hOwnHandle != 0 )
   {
      setChannelSelection( currentChannelSelection );

      currentTriggerValueCH1 = (int32_t)(config->value_ch1);
      currentTriggerValueCH2 = (int32_t)(config->value_ch2);

      if( currentChannelSelection == CHANNEL_SEL_CH1)
      {
          snprintf(textBuf, 10, "%d", currentTriggerValueCH1);
      }
      else if( currentChannelSelection == CHANNEL_SEL_CH2)
      {
         snprintf(textBuf, 10, "%d", currentTriggerValueCH2);
      }
      else
      {
         snprintf(textBuf, 10, "---");
      }
      hItem = WM_GetDialogItem(hOwnHandle, ID_TEXT_VALUE);
      TEXT_SetText(hItem, textBuf);

      setTriggerEdgeSelection(config->edge);
      setTriggerModeSelection(config->mode);
   }
}

